import React from 'react';

function Card(props) {
    return(
        <div class='bg-light-green dib br3 pa2 ma2 grow bw2 shadow-5'>
            <h1>Robofriens</h1>
            <img alt='robots' src='https://robohash.org/test?200x200'/>
            <div>
                <h2>{props.name}</h2>
                <p>{props.email}</p>
            </div>
        </div>
    );
}

export default Card;
